import React from "react";

const table = props => {
  console.log(props.moves);

  for(let moves in props.moves.data.quick)
  return (
    <div>
      <table>
        <tr>
          <th>Stats</th>
          <th>Move 1</th>
          <th>Move 2</th>
          {/* //need to check how many quick moves it has */}
          <th>Move 3</th>
        </tr>
        <tbody>
          <tr>
            <td>EPS</td>
            <td>5</td>
            <td>8</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
